import { useNavigate, useParams } from 'react-router-dom'

function SingleJob() {
    let {id} = useParams()
  return (
    <div>{BringSingleJob(id)}</div>
  )
}




function BringSingleJob(id){
    console.log(id)
    return(<>
        this is single job
    </>)
}






export default SingleJob
